import styled from 'styled-components';
export const Div0 = styled.div`
    width: 90%;
    height: 50%;
    margin-left: 0%;
    margin-top: 5%;
    border-radius: 5px;
    border: 2px solid #8E8E8E;
    float: left;
    display: flex;
    justify-content: center;
    align-items: center;

`
